article_content:
배송은 정말 빨랐어요!
제품은 불만족이요;;
우선 상판이 찍힘이 있었구요.
다리 조립은 수월하구요, 상판과 다리 연결해서 세워뒀는데,
책 한권 올리자마자 픽~쓰러지는???
나사가 계속 헛 돌고 조여주질 못해요.
그냥 빠져요;;;;;;
나사 고정해봐야 다시 뽑힘;;
조금 더 긴걸로 했더니 상판 위까지 조금 삐죽 나오고..
버리고 싶네요 ㅜㅜ

가격이싸서 예상은 했지만..
너무 가볍고 싼 느낌입니다.

지지대 봉용접은 날림이고 상판 시트지는 곧 벗겨지지 않을까 싶네요..--;

가격대비 만족 합니다...
약간 싼거같은 느낌이 좀 들기는 하지만, 싼걸 살려고 한건데 당연한 거겠죠... 상판이 쪼금 싼것 같은 느낌이 나요,, 이건 개인적인 느낌 입니다... 진짜 대리석도 아니고, 나무 원목도 아닌데 당연한 거라 뭐라 할수 없죠... ^^;;;
암튼 가격대비는 괜찮다고 생각 합니다.... 조립하기도 엄청 쉽구요.. 무게 많이 가벼움.. ^^;;;
5년정도까지 상판 필름지가 여름 겨울을 잘 버텨주기를.. 트더지거나 들뜨지 않기를 바라면서...^^**
